import React, { useState } from 'react';

import { Table, Space ,Button } from 'antd';

const columns = [
  {
    title: '名称',
    dataIndex: 'name',
    key: 'name',
    render: text => <a>{text}</a>,
  },
  {
    title: '收益代币',
    dataIndex: 'earnings',
    key: 'earnings',
  },
  {
    dataIndex: 'tags',
    key: 'tags',
    render: (text, record) => (
        <Space size="middle">
          <Button>EARN</Button>
          <Button>HAEVEST</Button>
        </Space>
    ),
  }
];

const data = [
  {
    key: '1',
    name: 'John Brown',
    age: 32,
    address: 'New York No. 1 Lake Park',
    tags: ['nice', 'developer'],
  },
  {
    key: '2',
    name: 'Jim Green',
    age: 42,
    address: 'London No. 1 Lake Park',
    tags: ['loser'],
  },
];

const InvestmentDetail = () => {

  return (
    <Table columns={columns} dataSource={data} />
  )
};

export default InvestmentDetail
